import React from 'react'
import {Container,Row,Col} from 'react-bootstrap';
import products from './'
const Home = () => {
    return (
        <div>
           <h1>Latest Products</h1> 
           <Row>
               {products.map}
           </Row>
        </div>
    )
}

export default Home
